import React from 'react';
import cart from '../../assets/cart.png'
import logo from '../../assets/free-heart-icon-492-thumb.png';
import { Link } from 'react-router-dom';
// import React, { useEffect, useState } from "react";

import {
  FaArrowRight,
  FaHeart,
} from 'react-icons/fa';
import {
  ProductsContainer,
  ProductsContainer1,
  ProductWrapper,
  ProductsHeading,
  ProductsHeading1,
  ProductTitle,
  ProductCard,
  ProductImg,
  ProductInfo,
  ProductInfo1,
  ProductDesc,
  ProductPrice,
  ProductButton,
  ProductButton1,
  Viewmore,
  ViewmoreButton
} from './ProductsElements';


const Products = ({ heading, heading1, data }) => {
  return (

    <ProductsContainer>
      <ProductsContainer1>
        <ProductsHeading>{heading}</ProductsHeading>
        <ProductsHeading1>{heading1}</ProductsHeading1>
      </ProductsContainer1>
      <ProductWrapper>
        {data.map((product, index) => {
          return (

            <ProductCard key={index}>
              <ProductImg src={product.image} alt={product.alt} />
              <ProductInfo>
                <ProductTitle>{product.title}</ProductTitle>
                <ProductDesc>{product.date}</ProductDesc>
                <ProductPrice>{product.description}</ProductPrice>
                <ProductInfo1>
                  <Link to='/story'>
                    <ProductButton>{product.button}</ProductButton>
                  </Link>


                  <Link to='/app' >
                    <ProductButton1 >
                      <FaHeart />
                    </ProductButton1>
                  </Link>


                </ProductInfo1>
              </ProductInfo>

            </ProductCard>






          );

        })}
      </ProductWrapper>

      < Viewmore>
        <Link to='/app' >
          <ViewmoreButton to ='/app' >View More Stories <FaArrowRight /></ViewmoreButton>
        </Link>
      </Viewmore>

    </ProductsContainer>

  );

};

export default Products;
